import React from 'react';

function Header() {
  return (
    <div id="intro">
      <h2 className="hover-color" style={{ fontFamily: 'Syncopate, sans-serif', fontWeight: '10' }}>
        &lt; PURP1E /&gt;
      </h2>
      <h3 style={{ fontFamily: 'Syncopate, sans-serif', fontWeight: '20' }}>Samudra K. Saikia</h3>
      <h1>
        <span
          className="txt-rotate"
          data-period="1000"
          data-rotate='[ "Gamer.", "Video Editor.", "Freelancer." ]'
        ></span>
      </h1>
    </div>
  );
}

export default Header;
